// Home.js
import React from "react";
import './Home.css';
import Lottie from "lottie-react";
import Animation from '../Animation.json';
import NavBar from '../NavBar/NavBar.js'
import Typewriter from "typewriter-effect";
 function Home() {
    return (
        <>

        <div className="container">
            <div>
                <h1 className="home">
                        <p> <Typewriter
                onInit={(typewriter) => {
                    typewriter
                        .typeString("GeeksForGeeks")
                        .pauseFor(1000)
                        .deleteAll()
                        .typeString("Welcomes You")
                        .start();
                }}
            /></p> 
                    <br />
                    I am a passionate Full Stack Software Developer with a focus on creating innovative
                    <br />
                    and user-friendly web and mobile applications. With expertise in JavaScript, React,
                    <br />
                    Node.js, and React Native, I strive to deliver high-quality solutions that meet client
                    <br />
                    needs and exceed expectations.
                </h1>
            </div>
            <div className="animation">
                <Lottie loop={true} animationData={Animation} />
            </div>

        </div>
            <button className="resume-button">See my Resume</button>
        </>
    );
}

export default Home;
